import React from "react";
import './AditionalCss/navigation.css'
import '../App.css'
import NavigationMenu from "./Nav";
import BookingForm from "./BookingForm";


const BookingPage = () => {
    return (
        <div>
            <NavigationMenu />
            <BookingForm />
        </div>
    )
}

export default BookingPage;
